import dash from 'lodash'

export default function slicer(items,currentPage,pageSize){
    console.log(dash(items))
    const start=(currentPage-1)*pageSize
    const list=dash.take(dash.slice(items,start),pageSize)
    console.log(list)
    return ;
}
